std::complex<double> DT::A1A1S1S1Tree(const double &cos_t, const double &s)
{
    std::complex<double> MHSqcomp = std::complex<double>(MH*MH,-MH*WH);
    std::complex<double> MS1Sqcomp = std::complex<double>(MS1*MS1,-MS1*WS1);
    
    double t =  (MA1*MA1) + (-s + cos_t*sqrt(s - 4.* (MA1*MA1))*sqrt(s - 4.* (MS1Sqcomp.real())))/2. +  (MS1Sqcomp.real());
	double u = -s - t + MA1*MA1 + MA1*MA1 + MS1Sqcomp.real() + MS1Sqcomp.real();
 
    return (token15*((MHSqcomp*(MHSqcomp + 2.*MS1Sqcomp)*token11*token20)/((MHSqcomp - s)*token14) + (token15* (MS1Sqcomp*MS1Sqcomp))/(-t +  (MA1*MA1)) + (token15* (MS1Sqcomp*MS1Sqcomp))/(-u +  (MA1*MA1)) + (3.* (MS1Sqcomp*MS1Sqcomp)*(token14* (token15*token15*token15) - token28* (token2*token2*token2)))/((MS1Sqcomp - s)*token14) - (MHSqcomp*token11*token20 + MS1Sqcomp*token14* (token15*token15*token15) - MS1Sqcomp*token28* (token2*token2*token2))/token14))/ (token28*token28);
}

